import React, {Component} from 'react';
import {Tree} from "antd";

class AddGroups extends Component {
    render() {
        const treeData = [
            {
                title: 'parent 1',
                key: '0-0',
                children: [
                    {
                        title: 'parent 1-0',
                        key: '0-0-0',
                        disabled: true,
                        children: [
                            {
                                title: 'leaf',
                                key: '0-0-0-0',
                                disableCheckbox: true,
                            },
                            {
                                title: 'leaf',
                                key: '0-0-0-1',
                            },
                        ],
                    },
                    {
                        title: 'parent 1-1',
                        key: '0-0-1',
                        children: [{ title: <span style={{ color: '#1890ff' }}>sss</span>, key: '0-0-1-0' }],
                    },
                ],
            },
        ];
        return (
            <Tree />
        );
    }
}

export default AddGroups;
